import { StyleSheet, Text, View, Button } from 'react-native'
import React from 'react'
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import SetPickUp from './screens/SetPickUp';
import HomeTabs from './screens/HomeTabs';

const Stack = createNativeStackNavigator();

const MainAccountScreen = (navigation) => {
  <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
    <Text>AccountScreen</Text>
    <Button onPress={() => navigation.navigate('StayturnScreen')} title="Button">Button</Button>
  </View>
}


const AccountScreen = () => {
  return (
    //<Stack.Navigator
    //  screenOptions={({ route }) => ({
    //    headerShown: false,
    //  })}
    //>
    //  <Stack.Screen name="MainAccountScreen" component={MainAccountScreen} />
    //  <Stack.Screen name="StayturnScreen" component={StayturnScreen} />
    //</Stack.Navigator>
    <Stack.Navigator
    screenOptions = {({route}) => ({
      headerShown: false,
    })}
    >
      <Stack.Screen name="Home" component={HomeTabs} />
      <Stack.Screen name="SetPickUp" component={SetPickUp} />
    </Stack.Navigator>
  )
}

export default AccountScreen

const styles = StyleSheet.create({})
